int main(void)
{
    set_A9_IRQ_stack ();
    config_GIC();

    enable_A9_interrupts ();
    config_interval_timer();

    while(1)
    {
		
        draw_title_image();
        while( !(*PUSHBUTTON_KEY_DATA_REG) )
        {}
        
        // reset game variables
        SysTick = 0;
        song_buffer_index = 0;
        green_button = 0;
        yellow_button = 0;
        red_button = 0;
        blue_button = 0;
        playerScore = 0;
        current_time = 0;
        screen_refresh_flag = 0;
        
        draw_static_graphics();
        memcpy((void *)&static_background_buffer[0], (void *)*PIXEL_BUF_CTRL_BUF_REG, PIXEL_BUFFER_SIZE); // save background image

    	init_audio_port();
		audio_port_ISR();
        
        while(SysTick<90000)
        {
            // The screen is refreshed every 100 ms (10 FPS)
            if(screen_refresh_flag)
            {
                current_time = SysTick;
                memcpy((void *)*PIXEL_BUF_CTRL_BUF_REG,(void *)&static_background_buffer[0], PIXEL_BUFFER_SIZE); // restore background image
                read_push_buttons();
                update_vga_screen();
                screen_refresh_flag = 0;
            }
            write_score();
            //UpdateSevSegDisplay(playerScore);
        }

    	deinit_audio_port();
	HAL_Delay(5000);
    }
    return 0;
}

