/* Define the IRQ exception handler */
void __attribute__ ((interrupt)) __cs3_isr_irq (void)
{
    // Read the ICCIAR from the processor interface
    int int_ID = *((int *) 0xFFFEC10C);
    if (int_ID == 199) // check if interrupt is from the HPS timer
    {
        //HPS_timer_ISR();
    }
    else if (int_ID == 72) // check if interrupt is from the Altera timer
    {
        interval_timer_ISR();
    }
    else if (int_ID == 73) // check if interrupt is from the KEYs
    {
        //pushbutton_ISR();
    }
    else if (int_ID == 78) // check if interrupt is from the audio port
    {
        audio_port_ISR();
    }
    else
    {
        while (1)
        {
        // if unexpected, then stay here
        } 
    }
    // Write to the End of Interrupt Register (ICCEOIR)
    *((int *) 0xFFFEC110) = int_ID;
    return;
}

/* Increment the global variable SysTick every ms */
void interval_timer_ISR (void)
{
    *INTERVAL_TIMER_STATUS_REG = 0; // clear the interrupt
    SysTick++;
    if( !(SysTick%SCREEN_REFRESH_INTERVAL_MS) )
    {
        screen_refresh_flag = 1;
    }
}

/* Periodically (every SCREEN_REFRESH_INTERVAL_MS) checks whether any button is pressed */
void read_push_buttons(void)
{
    int press = *PUSHBUTTON_KEY_DATA_REG;
    if(press & 0x8)
    {
       green_button_pressed();
       green_button = 1; 
    }
    else if(green_button)
    {
        green_button_released();
        green_button = 0;
    }
    if(press & 0x4)
    {
       red_button_pressed();
       red_button = 1; 
    }
    else if(red_button)
    {
        red_button_released();
        red_button = 0;
    }
    if(press & 0x2)
    {
       yellow_button_pressed();
       yellow_button = 1;
    }
    else if(yellow_button)
    {
        yellow_button_released();
        yellow_button = 0;
    }
    if(press & 0x1)
    {
       blue_button_pressed();
       blue_button = 1; 
    }
    else if(blue_button)
    {
        blue_button_released();
        blue_button = 0;
    }
}

