/* initialize the stack pointer for IRQ mode */
void set_A9_IRQ_stack (void)
{
    int stack, mode;
    stack = 0xFFFFFFF8; // top of A9 on-chip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = 0b11010010;
    asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
    /* set banked stack pointer */
    asm("mov sp, %[ps]" : : [ps] "r" (stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
}

/* configure the general interrupt controller */
void config_GIC (void)
{
    /* configure the HPS timer interrupt */
    *((int *) 0xFFFED8C4) = 0x01000000;
    *((int *) 0xFFFED118) = 0x00000080;
    /* configure the FPGA interval timer and KEYs and FPGA audio port interrupts */
    *((int *) 0xFFFED848) = 0x00000101;
    *((int *) 0xFFFED84C) = 0x00010000;
    *((int *) 0xFFFED108) = 0x00004300;
    //*((int *) 0xFFFED44C) = 0x00FF0000; // set interrupt priority of the FPGA audio port to 15 (lowest priority) 
    // Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all priorities
    *((int *) 0xFFFEC104) = 0xFFFF;
    // Set CPU Interface Control Register (ICCICR). Enable signaling of interrupts
    *((int *) 0xFFFEC100) = 1; // enable = 1
    // Configure the Distributor Control Register (ICDDCR) to send pending interrupts to CPUs
    *((int *) 0xFFFED000) = 1; // enable = 1
}

void config_interval_timer (void)
{
    *INTERVAL_TIMER_START_LOW_REG = 0x86A0; // corresponds to 100000 (10 ns * 100000 = 1 ms)
    *INTERVAL_TIMER_START_HIGH_REG = 0x0001;
    *INTERVAL_TIMER_CONTROL_REG = 7; // START|CONT|ITO
}

void init_audio_port(void)
{
    *AUDIO_PORT_CONTROL_REG = 0x2; // WE=1 so generate interrupt when write FIFOs are <25% full
}

void deinit_audio_port(void)
{
    *AUDIO_PORT_CONTROL_REG = 0x0; // WE=0 to stop interrupt generation
}

void enable_A9_interrupts (void)
{
    int status = 0b01010011;
    asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}

/* Encode single-digit decimal to seven segment bit-pattern */
uint8_t EncodeDecimalToSevSegment(uint8_t decimal_digit)
{
    switch(decimal_digit)
    {
        case 0:
            return 0x3F;
        case 1:
            return 0x06;
        case 2:
            return 0x5B;
        case 3:
            return 0x4F;
        case 4:
            return 0x66;
        case 5:
            return 0x6D;
        case 6:
            return 0x7D;
        case 7:
            return 0x07;
        case 8:
            return 0x7F;
        case 9:
            return 0x6F;
        default:
            return 0x00;
    }
}

void UpdateSevSegDisplay(uint32_t distance)
{
    uint8_t distance_thousands = (distance/1000) % 10; // 4th decimal digit of distance
    uint8_t distance_hundreds = (distance/100) % 10; // 3rd decimal digit of distance
    uint8_t distance_tens = (distance/10) % 10; // 2nd decimal digit of distance
    uint8_t distance_ones = distance % 10; // 1st decimal digit of distance

    *SEV_SEG3_ADRESS = EncodeDecimalToSevSegment(distance_thousands);
    *SEV_SEG2_ADRESS = EncodeDecimalToSevSegment(distance_hundreds);
    *SEV_SEG1_ADRESS = EncodeDecimalToSevSegment(distance_tens);
    *SEV_SEG0_ADRESS = EncodeDecimalToSevSegment(distance_ones);
}

