// Function to draw an elliptical button in a given rectangular region
void video_ellipse(int x1, int y1, int x2, int y2, short pixel_color) 
{
    int pixel_buf_ptr = *PIXEL_BUF_CTRL_BUF_REG;
    int pixel_ptr, row, col;

    float centerX = (x1 + x2) / 2;
    float centerY = (y1 + y2) / 2;
    float width = (x2 - x1) / 2;
    float height = (y2 - y1) / 2;

    // Draw the elliptical button within the given rectangular region
    for (row = y1; row <= y2; row++) 
    {
        for (col = x1; col <= x2; ++col) 
        {
            float dx = col - centerX;
            float dy = row - centerY;

            // Check if the current pixel is inside the ellipse equation
            if ((dx * dx) / (width * width) + (dy * dy) / (height * height) <= 1) 
            {
                pixel_ptr = pixel_buf_ptr + (row << 10) + (col << 1);
                if(pixel_ptr <= 0xC803BE7E)
                {
                    *(short*)pixel_ptr = pixel_color;
                }
            }
        }
    }
}

